import ExerciseContainer from "../components/exerciseContainer";

function Exercises() {

    const listExercises = () => {
        const [exercises, setExercises] = useState([]);

        //delete todo function

        const getExercises = async () => {
          try {
            const response = await fetch("http://localhost:5001/exercises");
            const jsonData = await response.json();

            setExercises(jsonData);
          } catch (err) {
            console.error(err.message);
          }
        };

        useEffect(() => {
          getExercises();
        }, []);
    }

    return ( 
        <div className="allExerciseContainer">
            <button>Übung hinzufügen</button>
            <form>
                <label>Muskel:</label>
                <select>
                    <option>Wähle aus</option>
                    <option>Brust</option>
                    <option>Rücken</option>
                    <option>Beine</option>
                    <option>Bizeps</option>
                    <option>Trizeps</option>
                    <option>Schultern</option>
                </select>
            </form>
            <div>
                {exercises.map(exercise => {
                    <ExerciseContainer />
                })}
            </div>
        </div>
     );
}

export default Exercises;
